import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";

const useStyles = makeStyles(theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
    marginLeft: "25%",
    marginRight: "25%"
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1)
  }
}));

const MovieForm = () => {
  const classes = useStyles();
  return (
    <>
      <form className={classes.container} noValidate autoComplete="off">
        <div>
          <TextField
            id="outlined-basic"
            className={classes.textField}
            label="Movie Title"
            margin="normal"
            variant="outlined"
            color="secondary"
            fullWidth={true}
            placeholder="Enter Title of the Movie"
          />
        </div>
        <div>
          <TextField
            id="outlined-basic"
            className={classes.textField}
            label="Genre"
            margin="normal"
            variant="outlined"
            color="secondary"
            fullWidth={true}
                      placeholder="Enter Title of the Movie"
          />
        </div>
        <div>
          <TextField
            id="outlined-basic"
            className={classes.textField}
            label="MovieTitle"
            margin="normal"
            variant="outlined"
            color="secondary"
            fullWidth={true}
          />
        </div>
        <div>
          <TextField
            id="outlined-basic"
            className={classes.textField}
            label="MovieTitle"
            margin="normal"
            variant="outlined"
            color="secondary"
            fullWidth={true}
          />
        </div>
      </form>
    </>
  );
};

export default MovieForm;
